import { Link } from 'react-router-dom'

const Navbar = (props) => {
    const showPopup = false;
    return ( 
        <nav className="navbar">
            <h1>KanBoard</h1>
            <div className="links">
                <Link to="/">Home</Link>
                <Link to="/" onClick={() => {
                    props.parentCallback(showPopup);
                    showPopup === !showPopup;
                }}>New Blog</Link>
            </div>
            <div>
            
            </div>
        </nav>
    );
} 
export default Navbar;
